import logo from './logo.svg';
import './App.css';
import GraduateAcc from './accounts/GraduateAcc';
import SavingAcc from './accounts/SavingsAcc';
import Transaction from './accounts/Transaction';
import NavBar from './NavBar';
import { BrowserRouter, Routes, Route } from 'react-router-dom';


function App() {
  return (
    <BrowserRouter>
      <div className="App">


        <h1>Account Name</h1>

        <div className="page-body">
        <NavBar />
          <Routes>
            <Route path="/" element={
              <div>
                <GraduateAcc />
                <SavingAcc />
              </div>
            } />
            <Route path="/graduate" element={<GraduateAcc/>} />
            <Route path="/savings" element={<SavingAcc/>} />
          </Routes>
        </div>
      </div>
    </BrowserRouter>
  );
}

export default App;
